import React, { Component } from 'react';


export default class extends Component {
    render() {
        return (
            <div className='container-fluid center'>
                <div class="row">
                    <div class="col-xs-12 col-sm-12 col-md-4 col-lg-4 bg-primary">
                        One of three columns
                    </div>
                    <div class="col-xs-12 col-sm-12 col-md-4 col-lg-4 bg-primary">
                        One of three columns
                    </div>
                    <div class="col-xs-12 col-sm-12 col-md-4 col-lg-4 bg-primary">
                        One of three columns
                    </div>
                </div>
            </div>
        );
    }
}
